/*

select

table_name || '_' || column_name || ': `select ''' || table_name || '_' || column_name || ''' tn, count(*) cnt from ' || table_name || ' a where ' || column_name || ' is null group by ' || column_name || '`,' q

from all_tab_columns i
where owner = 'CISADM'
and exists (
  select 1 from ci_md_mo_tbl t
  where trim(i.table_name) = trim(t.tbl_name)
)
and data_type = 'NUMBER';

*/

